import { Container, Stack, Box, Typography, TextField, Button } from '@mui/material';
import React, { useState } from 'react';
import { useSearchParams } from 'react-router-dom';

const Query = () => {
  let [searchParams, setSearchParams] = useSearchParams();
    return (
        <Box sx={{ display: "flex" }} >
            <Container sx={{ backgroundColor: "red", width: "25vw", height: "100vw" }}>
                aaa
            </Container>
            <Box sx={{ width: "75vw", height: "100vw" }}>
                <Box sx={{ position: "absolute", width: "75vw", backdropFilter: "blur(10px)",  padding: "10px", backgroundColor: "rgba(225, 225, 225, 0.8)", boxShadow: "-4px 9px 25px -6px rgba(0, 0, 0, 0.2)" }}>
                    Query <b>{searchParams.get("repo")}</b>
                </Box>
                <Container sx={{ backgroundColor: "green", width: "50vw", height: "100vw" }}>
                    aaa
                </Container>
                <Container sx={{ backgroundColor: "blue", width: "25vw", height: "100vw" }}>
                    aaa
                </Container>
            </Box>
        </Box>
    );
}

export default Query;
